import React from "react";
import { Botao } from "../../components/button/style";
import Header from "../../components/header";
import { LeftContainer, PageContainer, RightContainer } from "./style";

function Homepage() {
  return (
    <PageContainer>
      <Header />
      <LeftContainer>
        <Botao>Prever próximos 10 dias</Botao>
      </LeftContainer>
      <RightContainer />
    </PageContainer>
  );
}

export default Homepage;
